# HashMap in std::collections - Rust

```
pub struct HashMap<K, V, S = RandomState> { /* private fields */ }
```

Expand description

A [hash map](about:blank/index.html#use-a-hashmap-when "mod std::collections") implemented with quadratic probing and SIMD lookup.

By default, `HashMap` uses a hashing algorithm selected to provide resistance against HashDoS attacks. The algorithm is randomly seeded, and a reasonable best-effort is made to generate this seed from a high quality, secure source of randomness provided by the host without blocking the program. Because of this, the randomness of the seed depends on the output quality of the systemâ€™s random number coroutine when the seed is created. In particular, seeds generated when the systemâ€™s entropy pool is abnormally low such as during system boot may be of a lower quality.

The default hashing algorithm is currently SipHash 1-3, though this is subject to change at any point in the future. While its performance is very competitive for medium sized keys, other hashing algorithms will outperform it for small keys such as integers as well as large keys such as long strings, though those algorithms will typically _not_ protect against attacks such as HashDoS.

The hashing algorithm can be replaced on a per-`HashMap` basis using the [`default`](about:blank/default/trait.Default.html#tymethod.default "associated function std::default::Default::default"), [`with_hasher`](about:blank/hash_map/struct.HashMap.html#method.with_hasher "associated function std::collections::hash_map::HashMap::with_hasher"), and [`with_capacity_and_hasher`](about:blank/hash_map/struct.HashMap.html#method.with_capacity_and_hasher "associated function std::collections::hash_map::HashMap::with_capacity_and_hasher") methods. There are many alternative [hashing algorithms available on crates.io](https://crates.io/keywords/hasher).

It is required that the keys implement the [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") and [`Hash`](../hash/trait.Hash.html "trait std::hash::Hash") traits, although this can frequently be achieved by using `#[derive(PartialEq, Eq, Hash)]`. If you implement these yourself, it is important that the following property holds:

```text
k1 == k2 -> hash(k1) == hash(k2)

```

In other words, if two keys are equal, their hashes must be equal. Violating this property is a logic error.

It is also a logic error for a key to be modified in such a way that the keyâ€™s hash, as determined by the [`Hash`](../hash/trait.Hash.html "trait std::hash::Hash") trait, or its equality, as determined by the [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") trait, changes while it is in the map. This is normally only possible through [`Cell`](../cell/struct.Cell.html "struct std::cell::Cell"), [`RefCell`](../cell/struct.RefCell.html "struct std::cell::RefCell"), global state, I/O, or unsafe code.

The behavior resulting from either logic error is not specified, but will be encapsulated to the `HashMap` that observed the logic error and not result in undefined behavior. This could include panics, incorrect results, aborts, memory leaks, and non-termination.

The hash table implementation is a Rust port of Googleâ€™s [SwissTable](https://abseil.io/blog/20180927-swisstables). The original C++ version of SwissTable can be found [here](https://github.com/abseil/abseil-cpp/blob/master/absl/container/internal/raw_hash_set.h), and this [CppCon talk](https://www.youtube.com/watch?v=ncHmEUmJZf4) gives an overview of how the algorithm works.

## [Â§](#examples)Examples

```
use std::collections::HashMap;

// Type inference lets us omit an explicit type signature (which
// would be `HashMap<String, String>` in this example).
let mut book_reviews = HashMap::new();

// Review some books.
book_reviews.insert(
    "Adventures of Huckleberry Finn".to_string(),
    "My favorite book.".to_string(),
);
book_reviews.insert(
    "Grimms' Fairy Tales".to_string(),
    "Masterpiece.".to_string(),
);
book_reviews.insert(
    "Pride and Prejudice".to_string(),
    "Very enjoyable.".to_string(),
);
book_reviews.insert(
    "The Adventures of Sherlock Holmes".to_string(),
    "Eye lyked it alot.".to_string(),
);

// Check for a specific one.
// When collections store owned values (String), they can still be
// queried using references (&str).
if !book_reviews.contains_key("Les MisÃ©rables") {
    println!("We've got {} reviews, but Les MisÃ©rables ain't one.",
             book_reviews.len());
}

// oops, this review has a lot of spelling mistakes, let's delete it.
book_reviews.remove("The Adventures of Sherlock Holmes");

// Look up the values associated with some keys.
let to_find = ["Pride and Prejudice", "Alice's Adventure in Wonderland"];
for &book in &to_find {
    match book_reviews.get(book) {
        Some(review) => println!("{book}: {review}"),
        None => println!("{book} is unreviewed.")
    }
}

// Look up the value for a key (will panic if the key is not found).
println!("Review for Jane: {}", book_reviews["Pride and Prejudice"]);

// Iterate over everything.
for (book, review) in &book_reviews {
    println!("{book}: \"{review}\"");
}
```

