The easiest way to use `HashMap` with a custom key type is to derive [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") and [`Hash`](../hash/trait.Hash.html "trait std::hash::Hash"). We must also derive [`PartialEq`](../cmp/trait.PartialEq.html "trait std::cmp::PartialEq").

```
use std::collections::HashMap;

#[derive(Hash, Eq, PartialEq, Debug)]
struct Viking {
    name: String,
    country: String,
}

impl Viking {
    /// Creates a new Viking.
    fn new(name: &str, country: &str) -> Viking {
        Viking { name: name.to_string(), country: country.to_string() }
    }
}

// Use a HashMap to store the vikings' health points.
let vikings = HashMap::from([
    (Viking::new("Einar", "Norway"), 25),
    (Viking::new("Olaf", "Denmark"), 24),
    (Viking::new("Harald", "Iceland"), 12),
]);

// Use derived implementation to print the status of the vikings.
for (viking, health) in &vikings {
    println!("{viking:?} has {health} hp");
}
```

