1.7.0 (const: [unstable](https://github.com/rust-lang/rust/issues/102575 "Tracking issue for const_collections_with_hasher")) Â· [source](about:blank/src/std/collections/hash/map.rs.html#283-285)

Creates an empty `HashMap` which will use the given hash builder to hash keys.

The created map has the default initial capacity.

Warning: `hash_builder` is normally randomly generated, and is designed to allow HashMaps to be resistant to attacks that cause many collisions and very poor performance. Setting it manually using this function can expose a DoS attack vector.

The `hash_builder` passed should implement the [`BuildHasher`](../hash/trait.BuildHasher.html "trait std::hash::BuildHasher") trait for the HashMap to be useful, see its documentation for details.

##### [Â§](#examples-3)Examples

```
use std::collections::HashMap;
use std::hash::RandomState;

