ðŸ”¬This is a nightly-only experimental API. (`hash_extract_if`Â [#59618](https://github.com/rust-lang/rust/issues/59618))

Creates an iterator which uses a closure to determine if an element should be removed.

If the closure returns true, the element is removed from the map and yielded. If the closure returns false, or panics, the element remains in the map and will not be yielded.

Note that `extract_if` lets you mutate every value in the filter closure, regardless of whether you choose to keep or remove it.

If the returned `ExtractIf` is not exhausted, e.g. because it is dropped without iterating or the iteration short-circuits, then the remaining elements will be retained. Use [`retain`](about:blank/hash_map/struct.HashMap.html#method.retain "method std::collections::hash_map::HashMap::retain") with a negated predicate if you do not need the returned iterator.

##### [Â§](#examples-16)Examples

Splitting a map into even and odd keys, reusing the original map:

```
#![feature(hash_extract_if)]
use std::collections::HashMap;

let mut map: HashMap<i32, i32> = (0..8).map(|x| (x, x)).collect();
let extracted: HashMap<i32, i32> = map.extract_if(|k, _v| k % 2 == 0).collect();

let mut evens = extracted.keys().copied().collect::<Vec<_>>();
let mut odds = map.keys().copied().collect::<Vec<_>>();
evens.sort();
odds.sort();

assert_eq!(evens, vec![0, 2, 4, 6]);
assert_eq!(odds, vec![1, 3, 5, 7]);
```

