ðŸ”¬This is a nightly-only experimental API. (`hash_raw_entry`Â [#56167](https://github.com/rust-lang/rust/issues/56167))

Creates a raw entry builder for the HashMap.

Raw entries provide the lowest level of control for searching and manipulating a map. They must be manually initialized with a hash and then manually searched. After this, insertions into a vacant entry still require an owned key to be provided.

Raw entries are useful for such exotic situations as:

-   Hash memoization
-   Deferring the creation of an owned key until it is known to be required
-   Using a search key that doesnâ€™t work with the Borrow trait
-   Using custom comparison logic without newtype wrappers

Because raw entries provide much more low-level control, itâ€™s much easier to put the HashMap into an inconsistent state which, while memory-safe, will cause the map to produce seemingly random results. Higher-level and more foolproof APIs like `entry` should be preferred when possible.

In particular, the hash used to initialize the raw entry must still be consistent with the hash of the key that is ultimately stored in the entry. This is because implementations of HashMap may need to recompute hashes when resizing, at which point only the keys are available.

Raw entries give mutable access to the keys. This must not be used to modify how the key would compare or hash, as the map will not re-evaluate where the key should go, meaning the keys may become â€œlostâ€ if their location does not reflect their state. For instance, if you change a key so that the map now contains keys which compare equal, search may start acting erratically, with two keys randomly masking each other. Implementations are free to assume this doesnâ€™t happen (within the limits of memory-safety).

